import React, {Component} from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import Slider, { Range } from 'rc-slider';

import 'rc-slider/assets/index.css';
const wrapperStyle = { width: 400, margin: 50 };
          // <Slider step={20, 'dots'} max={'100'}/>

class SearchProperties extends Component {

  constructor(props) {
    super(props)
    this.state = {
      bedrooms: ''
    }
  }

  onSliderChangeBedrooms = (e) => {
    // console.log(e);
    this.setState({bedrooms: e})
  }

  render(){
    return(
      <div className="searchproperties">

        <div style={wrapperStyle} className="searchBedrooms">
          <p>Min Bedrooms</p>
          <Slider min={0} defaultValue={0} marks={{ 0: 0, 1: 1, 2: 2, 3: 3, 4: 4}} step={null} onChange={this.onSliderChange} max={4} />
        </div>
        <div style={wrapperStyle} className="searchBathrooms">
          <p>Min Bathrooms</p>
          <Slider min={0} defaultValue={0} marks={{ 0: 0, 1: 1, 2: 2, 3: 3, 4: 4}} step={null} onChange={this.onSliderChange} max={4} />
        </div>
        <div style={wrapperStyle} className="maxPrice">
          <p>Min Bathrooms</p>
          <Slider min={0} defaultValue={0} marks={{ 1: 1000000, 2: 2000000, 3: 3000000, 5: 5000000, 10: 10000000}} step={null} onChange={this.onSliderChange} max={4} />
        </div>

      </div>
    )
  }
}

export default SearchProperties
